const initstate = {
    giohang : [],
};

const reducers = (state = initstate, action) => {
    switch (action.type) {
        case 'Add_SanPham':
            console.log(action.dulieu )
            return { ...state, giohang: action.dulieu }
      default:
        return state;
    }
  }
  
  export default reducers;
